INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("リリ", 1, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 2, 321, 40011, 0, 1, 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("クリア", 1, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 2, 322, 40011, 0, 2, 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("プレシア", 1, 1, "んーと。\nこれ、あげる。\nはい", 126101, 2, 323, 40011, 0, 3, 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("リリ", 1, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 2, 324, 40011, 0, 4, 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("クリア", 1, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 2, 325, 40011, 0, 5, 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("プレシア", 1, 2, "お兄。\nきてくれて、うれしい", 126101, 2, 326, 40011, 0, 6, 24001);
